import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Logo from '../resources/myLogo.png'
import 'nav.css'

function MyNav() {
    return (
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Container>
                <Navbar.Brand href="#home">
                    <img src={Logo} width={75}/>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">
                        {/*<Nav.Link href="#features">Siya Choudhary</Nav.Link>*/}
                    </Nav>
                    <Nav>
                        <Nav.Link href="#aboutMe" className={"linkItem"}>About</Nav.Link>
                        <NavDropdown title="My Portfolios" id="collasible-nav-dropdown" className={"linkItem"}>
                            <NavDropdown.Item href="#action/3.1">Art</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.3">Technology</NavDropdown.Item>
                        </NavDropdown>
                        <Nav.Link href="#contactMe" className={"linkItem"}>Contact</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default MyNav;
